  `client_addr` varchar(64) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '投票者收款地址',
  `payment_date` date NULL DEFAULT NULL COMMENT '投票者收益的日期',
  `payment_money` decimal(30, 10) NULL DEFAULT NULL COMMENT '投票者在这个日期内的收益',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 27 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Dynamic;

