DROP TABLE IF EXISTS `Tx`;
CREATE TABLE `Tx`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `block_hash` varchar(64) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `txid` varchar(64) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `form` varchar(64) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
