  PRIMARY KEY (`id`) USING BTREE,
  INDEX `block_id`(`block_hash`) USING BTREE,
  INDEX `txid`(`txid`) USING BTREE,
  INDEX `spend_txid`(`spend_txid`) USING BTREE,
